【商品紹介】<br>　・1泊分のお手入れに必要なスキンケアアイテムがセットになった、出張や急な外泊に便利なトライアルセットです。<br>　・クレンジングオイル、洗顔料(2回分)、化粧水(2回分)、夜用乳液、朝用乳液が入っています。<br>　・更に角栓をすっきり除去できる、使い心地の良い「角栓すっきりスーパー黒パック」も、1回分付いています。<br>　・携帯しやすいコンパクトサイズでありながら、本格的なお手入れができます。<br><br>

【使用上の注意】<br>　・傷やはれもの、湿しん等、お肌にに異常のあるときはお使いにならないでください。<br>　・使用中、赤み、はれ、かゆみ、刺激等の異常があらわれた場合は、ご使用を中止し、皮ふ科専門医等へご相談ください。<br>　・そのまま使用を続けますと、症状が悪化することがあります。<br><br><hr>【内容量】 クレンジングオイル1包、化粧水2包、朝用乳液 (SPA15、PA+)1包、洗顔料2包、夜用乳液1包、角栓黒パック1包　<br><br>【発売元】　コーセーコスメポート<hr>区分：化粧品<hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
